import React, { PureComponent } from 'react';

class Footer extends PureComponent {
    state = {  }
    render() { 
        return (
            <React.Fragment>
                <hr/>
                <p> Copyright &copy; 2018 - Developed by: <a href="https://facebook.com/oYo.LuKman" target="_blank">Lukman</a>.</p>

                {/* <!-- jQuery --> */}
                <script src="assets/vendor/jquery/jquery.min.js"></script>
                {/* <!-- Bootstrap Core JavaScript --> */}
                <script src="assets/vendor/bootstrap/js/bootstrap.min.js"></script>
                {/* <!-- Metis Menu Plugin JavaScript --> */}
                <script src="assets/vendor/metisMenu/metisMenu.min.js"></script>

                {/* <!-- Flot Charts JavaScript --> */}
                <script src="assets/vendor/flot/excanvas.min.js"></script>
                <script src="assets/vendor/flot/jquery.flot.js"></script>
                <script src="assets/vendor/flot/jquery.flot.pie.js"></script>
                <script src="assets/vendor/flot/jquery.flot.resize.js"></script>
                <script src="assets/vendor/flot/jquery.flot.time.js"></script>
                <script src="assets/vendor/flot-tooltip/jquery.flot.tooltip.min.js"></script>
                <script src="assets/data/flot-data.js"></script>

                {/* <!-- Morris Charts JavaScript --> */}
                <script src="assets/vendor/raphael/raphael.min.js"></script>
                <script src="assets/vendor/morrisjs/morris.min.js"></script>
                <script src="assets/data/morris-data.js"></script>

                {/* <!-- DataTables JavaScript --> */}
                <script src="assets/vendor/datatables/js/jquery.dataTables.min.js"></script>
                <script src="assets/vendor/datatables-plugins/dataTables.bootstrap.min.js"></script>
                <script src="assets/vendor/datatables-responsive/dataTables.responsive.js"></script>

                {/* <!-- Custom Theme JavaScript --> */}
                <script src="assets/dist/js/sb-admin-2.js"></script>

                {/* <!-- Page-Level Demo Scripts - Tables - Use for reference --> */}
                {/* <script>
                    $(document).ready(function() {
                        $('#dataTables-example').DataTable({
                            responsive: true
                        });
                    });
                </script> */}
            </React.Fragment>
        );
    }
}

export default Footer;
